  selector: 'app-dailog-signup',
  templateUrl: './dailog-signup.component.html',
  styleUrls: ['./dailog-signup.component.css']
})
export class DailogSignupComponent {
  password: any;
  email: any;
  name: any;




  onSubmit(details: NgForm) {
    console.log(details.value)
  }

}
